<!DOCTYPE html>
<html lang="he" dir="rtl">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
<title> 专 拽住 砖 注</title>
<style>
*{margin:0;padding:0;box-sizing:border-box}
html,body{width:100%;height:100%;overflow:hidden}
body{font-family:'Segoe UI',Tahoma,sans-serif;background:#fce4ec;display:flex;flex-direction:column}
.bsd{font-size:11px;color:#c06080;font-weight:bold;position:absolute;right:10px}
.top-bar{background:#f8bbd0;padding:5px 10px;display:flex;align-items:center;position:relative}
.top-title{font-size:clamp(13px,3vw,17px);font-weight:bold;color:#880e4f;text-align:center;flex:1}
.main{flex:1;display:flex;flex-direction:column;overflow:hidden}
.doll-stage{flex:1;display:flex;justify-content:center;align-items:center;position:relative;min-height:0}
.doll-wrap{position:relative;height:92%;max-height:420px;aspect-ratio:200/380}
.doll-base{width:100%;height:100%;object-fit:contain;position:relative;z-index:5}
.cloth-img{position:absolute;object-fit:contain;pointer-events:none;opacity:0;transition:opacity .25s}
.cloth-img.on{opacity:1;pointer-events:auto;cursor:grab;touch-action:none}
.cloth-img.on:active{cursor:grabbing}
.btn-row{position:absolute;bottom:4px;right:4px;display:flex;gap:4px;z-index:20}
.circle-btn{background:#fff;border:2px solid #f48fb1;border-radius:50%;width:34px;height:34px;font-size:16px;cursor:pointer;display:flex;align-items:center;justify-content:center}
.circle-btn:active{transform:scale(.9);background:#fce4ec}
.controls{position:absolute;bottom:4px;left:4px;display:none;flex-direction:column;gap:5px;z-index:20;background:rgba(255,240,245,.95);border:2px solid #f48fb1;border-radius:12px;padding:8px}
.controls.show{display:flex}
.ctrl-row{display:flex;align-items:center;height:28px}
.ctrl-row span{display:inline-block;width:55px;font-size:10px;color:#880e4f;font-weight:bold}
.ctrl-btn{background:#fff;border:2px solid #f48fb1;border-radius:8px;width:28px;height:28px;font-size:14px;cursor:pointer;color:#880e4f;font-weight:bold;display:inline-flex;align-items:center;justify-content:center;margin-left:4px}
.ctrl-btn:active{background:#fce4ec;transform:scale(.9)}
.label-pop{position:absolute;top:4px;left:50%;transform:translateX(-50%);background:#fff;border:2px solid #f8bbd0;border-radius:12px;padding:3px 12px;font-size:12px;font-weight:bold;color:#880e4f;z-index:20;opacity:0;transition:opacity .3s}
.label-pop.show{opacity:1}
.ward-panel{background:#fff0f5;border-top:2px solid #f8bbd0;display:flex;flex-direction:column;max-height:42%}
.ward-tabs{display:flex;gap:2px;padding:3px 4px;overflow-x:auto;flex-shrink:0;-webkit-overflow-scrolling:touch}
.ward-tabs::-webkit-scrollbar{display:none}
.ward-tab{background:#fff;border:2px solid #f48fb1;border-radius:10px;padding:2px 7px;font-size:clamp(9px,1.9vw,11px);cursor:pointer;color:#880e4f;font-weight:bold;white-space:nowrap;flex-shrink:0}
.ward-tab.active{background:#f48fb1;color:white}
.ward-items{display:grid;grid-template-columns:repeat(4,1fr);gap:4px;padding:3px 4px;overflow-y:auto;flex:1;-webkit-overflow-scrolling:touch}
.ward-item{background:white;border:2px solid #f8bbd0;border-radius:10px;padding:3px;text-align:center;cursor:pointer;transition:all .15s}
.ward-item:active{transform:scale(.93)}
.ward-item img{width:100%;height:42px;object-fit:contain}
.ward-item .wn{font-size:clamp(7px,1.5vw,9px);color:#880e4f;font-weight:bold;line-height:1.1}
.ward-item.on{border-color:#ec407a;background:#fce4ec}
.toast{position:fixed;bottom:14px;left:50%;transform:translateX(-50%) translateY(50px);background:#ec407a;color:white;padding:7px 18px;border-radius:16px;font-weight:bold;font-size:12px;z-index:100;transition:transform .3s}
.toast.show{transform:translateX(-50%) translateY(0)}
</style>
</head>

<div class="top-bar"><div class="bsd">住状</div><div class="top-title"> 专 拽住 砖 注</div></div>

var active={};
var undoStack=[];
var curCat='dresses';
var selectedId=null;
var dragging=null,dragStartX=0,dragStartY=0,dragOrigLeft=0,dragOrigTop=0;
var tabNames={dresses:' 砖转',tops:' 爪转',skirts:' 爪转',pants:' 住',hats:' 注',glasses:'讹 砖拽驻',accessories:' 专'};

function init(){
  var wrap=document.getElementById('dollWrap');
  for(var id in POS){
    var img=document.createElement('img');
    img.className='cloth-img';img.id='ci-'+id;img.src=IMG[id]||'';
    var p=POS[id];
    img.style.top=p.top;img.style.left=p.left;img.style.width=p.width;img.style.height=p.height;img.style.zIndex=p.z;
    wrap.appendChild(img);
  }
  renderTabs();renderWard();
}
function renderTabs(){
  var c=document.getElementById('tabs');c.innerHTML='';
  for(var cat in CAT){
    var b=document.createElement('button');
    b.className='ward-tab'+(cat===curCat?' active':'');
    b.textContent=tabNames[cat]||cat;
    b.setAttribute('data-cat',cat);
    b.onclick=function(){curCat=this.getAttribute('data-cat');renderTabs();renderWard()};
    c.appendChild(b);
  }
}
function renderWard(){
  var c=document.getElementById('wardItems');c.innerHTML='';
  CAT[curCat].forEach(function(it){
    var d=document.createElement('div');
    d.className='ward-item'+(active[it.id]?' on':'');
    d.innerHTML='<img src="'+IMG[it.id]+'"/><div class="wn">'+it.name+'</div>';
    d.onclick=function(){toggleItem(it)};
    c.appendChild(d);
  });
}
function toggleItem(it){
  var p=POS[it.id];if(!p)return;
  if(active[it.id]){
    active[it.id]=false;
    document.getElementById('ci-'+it.id).classList.remove('on');
    undoStack=undoStack.filter(function(h){return h!==it.id});
  }else{
    var t=p.type;
    if(t==='body'||t==='top'){
      for(var oid in active){if(!active[oid])continue;var ot=POS[oid]&&POS[oid].type;
        if(t==='body'&&(ot==='body'||ot==='top')){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}
        if(t==='top'&&ot==='body'){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}
      }
    }
    if(t==='bottom'){for(var oid in active){if(active[oid]&&POS[oid]&&POS[oid].type==='bottom'){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}}}
    if(t==='feet'){for(var oid in active){if(active[oid]&&POS[oid]&&POS[oid].type==='feet'){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}}}
    if(t==='head'){for(var oid in active){if(active[oid]&&POS[oid]&&POS[oid].type==='head'){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}}}
    if(t==='face'){for(var oid in active){if(active[oid]&&POS[oid]&&POS[oid].type==='face'){active[oid]=false;document.getElementById('ci-'+oid).classList.remove('on');undoStack=undoStack.filter(function(h){return h!==oid})}}}
    active[it.id]=true;
    document.getElementById('ci-'+it.id).classList.add('on');
    undoStack.push(it.id);
    selectItem(it.id);
  }
  showLbl(it.name);renderWard();
}
function undoLast(){
  if(undoStack.length===0){showToast('  住专');return}
  var last=undoStack.pop();
  if(last&&active[last]){
    active[last]=false;
    var el=document.getElementById('ci-'+last);
    if(el)el.classList.remove('on');
  }
  renderWard();showToast('住专! ╋');
}
function resetAll(){
  for(var id in active){active[id]=false;var e=document.getElementById('ci-'+id);if(e)e.classList.remove('on')}
  undoStack=[];selectedId=null;document.getElementById('controls').classList.remove('show');
  renderWard();showToast('转 砖! ');
}
function downloadImg(){
  var wrap=document.getElementById('dollWrap');
  var canvas=document.createElement('canvas');
  var rect=wrap.getBoundingClientRect();
  canvas.width=rect.width*2;canvas.height=rect.height*2;
  var ctx=canvas.getContext('2d');
  ctx.scale(2,2);ctx.fillStyle='#fce4ec';ctx.fillRect(0,0,rect.width,rect.height);
  var imgs=Array.from(wrap.querySelectorAll('img'));
  imgs.sort(function(a,b){return(parseInt(a.style.zIndex)||0)-(parseInt(b.style.zIndex)||0)});
  imgs.forEach(function(img){
    if(!img.classList.contains('doll-base')&&!img.classList.contains('on'))return;
    var iR=img.getBoundingClientRect();
    ctx.drawImage(img,iR.left-rect.left,iR.top-rect.top,iR.width,iR.height);
  });
  setTimeout(function(){
    canvas.toBlob(function(blob){
      if(navigator.share){
        var file=new File([blob],'lior_doll.png',{type:'image/png'});
        navigator.share({files:[file],title:' 砖 注'}).catch(function(){});
      }else{
        var a=document.createElement('a');a.href=URL.createObjectURL(blob);a.download='lior_doll.png';a.click();
      }
    });
  },100);
  showToast(' 砖专...');
}
function selectItem(id){selectedId=id;document.getElementById('controls').classList.add('show')}
function adjSize(d){
  if(!selectedId||!active[selectedId])return;
  var el=document.getElementById('ci-'+selectedId);
  var w=parseFloat(el.style.width)||100;var nw=Math.max(20,Math.min(250,w+d));
  var h=parseFloat(el.style.height)||100;
  el.style.width=nw+'%';el.style.height=(nw*(h/w))+'%';
}
function adjPos(p,d){
  if(!selectedId||!active[selectedId])return;
  var el=document.getElementById('ci-'+selectedId);
  el.style[p]=(parseFloat(el.style[p])||0)+d+'%';
}
document.addEventListener('pointerdown',function(e){
  var el=e.target;if(!el.classList.contains('cloth-img')||!el.classList.contains('on'))return;
  e.preventDefault();dragging=el;selectItem(el.id.replace('ci-',''));
  dragStartX=e.clientX;dragStartY=e.clientY;
  dragOrigLeft=parseFloat(el.style.left)||0;dragOrigTop=parseFloat(el.style.top)||0;
  var w=document.getElementById('dollWrap');dragging._ww=w.offsetWidth;dragging._wh=w.offsetHeight;
});
document.addEventListener('pointermove',function(e){
  if(!dragging)return;e.preventDefault();
  dragging.style.left=(dragOrigLeft+(e.clientX-dragStartX)/dragging._ww*100)+'%';
  dragging.style.top=(dragOrigTop+(e.clientY-dragStartY)/dragging._wh*100)+'%';
});
document.addEventListener('pointerup',function(){dragging=null});
function showLbl(t){var e=document.getElementById('lbl');e.textContent=t;e.classList.add('show');setTimeout(function(){e.classList.remove('show')},1200)}
function showToast(t){var e=document.getElementById('toast');e.textContent=t;e.classList.add('show');setTimeout(function(){e.classList.remove('show')},1600)}
init();
